    <script>
        d3.select("svg").selectAll(".region")
            .on('mouseover', function () {
                var id;
                
                this.classList.forEach(function(el){
                    if(el.indexOf("id") === 0){
                        id = el;
                    }
                });
                d3.selectAll("."+id).attr("class", "region over id")
            })
            .on('mouseout', function () {
                var id;
                this.classList.forEach(function(el){
                    if(el.indexOf("id") === 0){
                        id = el;
                    }
                });
                
                d3.selectAll("."+id).attr("class", "region id")
            });
    </script>
